function fetchMetData(){
    fetch('https://collectionapi.metmuseum.org/public/collection/v1/search?isOnView=true&q=modern')
    .then(function (response) {
        if (response.ok) {
            return response.json();
        } else {
            return Promise.reject(response);
        }
    }
    )
}

